                                      variant="body1"
                                      style={{ fontWeight: 600 }}
                                    >
                                      {input.textlabel}
                                    </Typography>
                                  </Grid>

                                  <Grid item>
                                    <InputField
                                      variant="outlined"
                                      fullWidth={input.fullWidth}
                                      type={input.type}
                                      size="small"
                                      handleChange={(e) =>
                                        handleEventChange("dropdown", input, e)
                                      }
                                      handleBlur={(e) =>
                                        handleBlurChange("dropdown", input, e)
                                      }
                                      value={input.value}
                                      name={input.name}
                                      error={input.errState}
                                    />
                                    {input.errState ? (
                                      <Typography color="secondary">
                                        {input.value === ""
                                          ? input.errEmptyMsg
                                          : input.value.length < 3
                                          ? input.errMinMsg
                                          : input.value.length > 10
                                          ? input.errMaxMsg
                                          : null}
                                      </Typography>
                                    ) : null}
                                  </Grid>
                                </Grid>
                              </Grid>
                            </>
                          )}
                        </>
                      ))}

                      <Grid
                        container
                        xs={12}
                        spacing={3}
                        style={{ marginLeft: "3px" }}
                      >
                        {testData.textfield.map((input: any, index: any) => (
                          <Grid item xs={6} md={4} lg={3}>
                            <Grid container direction="column">
                              <Grid item>
                                <Typography
                                  variant="body1"
                                  style={{ fontWeight: 600 }}
                                  key={index}
                                >
                                  {input.textlabel}
                                </Typography>
                              </Grid>

                              <Grid item>
                                <InputField
                                  variant="outlined"
                                  fullWidth={input.fullWidth}
                                  type={input.type}
                                  size="small"
                                  handleChange={(e) =>
                                    handleEventChange("textfield", input, e)
                                  }
                                  handleBlur={(e) =>
                                    handleBlurChange("textfield", input, e)
                                  }
                                  value={input.value}
                                  name={input.name}
                                  error={input.errState}
                                />
                                {input.errState ? (
                                  <Typography color="secondary">
                                    {input.value === ""
                                      ? input.errEmptyMsg
                                      : input.value.length < 3
                                      ? input.errMinMsg
                                      : input.value.length > 15
                                      ? input.errMaxMsg
                                      : null}
                                  </Typography>
                                ) : null}
                              </Grid>
                            </Grid>
                          </Grid>
                        ))}
                      </Grid>

                      {testData.textfield1.map((input: any, index: any) => (
                        <Grid item xs={6} md={4} lg={3}>
                          <Grid container direction="column">
                            <Grid item>
                              <Typography
                                variant="body1"
                                style={{ fontWeight: 600 }}
                                key={index}
                              >
                                {input.textlabel}
                              </Typography>
                            </Grid>

                            <Grid item>
                              <InputField
                                variant="outlined"
                                fullWidth={input.fullWidth}
                                type={input.type}
                                size="small"
                                handleChange={(e) =>
                                  handleEventChange("textfield1", input, e)
                                }
                                handleBlur={(e) =>
                                  handleBlurChange("textfield1", input, e)
                                }
                                value={input.value}
                                name={input.name}
                                error={input.errState}
                              />
                              {input.errState ? (
                                <Typography color="secondary">
                                  {input.value === ""
                                    ? input.errEmptyMsg
                                    : input.value.length < 3
                                    ? input.errMinMsg
                                    : input.value.length > 15
                                    ? input.errMaxMsg
                                    : null}
                                </Typography>
                              ) : null}
                            </Grid>
                          </Grid>
                        </Grid>
                      ))}

                      {testData.textfield2.map((input: any, index: any) => (
                        <Grid item xs={6} md={4} lg={3}>
                          <Grid container direction="column">
                            <Grid item>
                              <Typography
                                variant="body1"
                                style={{ fontWeight: 600 }}
                                key={index}
                              >
                                {input.textlabel}
                              </Typography>
                            </Grid>

                            <Grid item>
                              <InputField
                                variant="outlined"
                                fullWidth={input.fullWidth}
                                type={input.type}
                                size="small"
                                id={input.name}
                                handleChange={(e) =>
                                  handleEventChange("textfield2", input, e)
                                }
                                handleBlur={(e) =>
                                  handleBlurChange("textfield2", input, e)
                                }
                                value={input.value}
                                name={input.name}
                                error={input.errState}
                                phoneNumberFormatter={phoneNumberFormatter}
                              />
                              {input.errState ? (
                                <Typography color="secondary">
                                  {input.value === ""
                                    ? input.errEmptyMsg
                                    : !/^(\([0-9]{3}\) |[0-9]{3}-)[0-9]{3}-[0-9]{4}$/.test(
                                        input.value
                                      )
                                    ? input.errMinMsg
                                    : null}
                                </Typography>
                              ) : null}
                            </Grid>
                          </Grid>
                        </Grid>
                      ))}

                      {testData.textfield3.map((input: any, index: any) => (
                        <Grid item xs={6}>
                          <Grid container direction="column">
                            <Grid item>
                              <Typography
                                variant="body1"
                                style={{ fontWeight: 600 }}
                                key={index}
                              >
                                {input.textlabel}
                              </Typography>
                            </Grid>

                            <Grid item>
                              <InputField
                                variant="outlined"
                                fullWidth={input.fullWidth}
                                type={input.type}
                                size="small"
                                handleChange={(e) =>
                                  handleEventChange("textfield3", input, e)
                                }
                                handleBlur={(e) =>
                                  handleBlurChange("textfield3", input, e)
                                }
                                value={input.value}
                                name={input.name}
                                error={input.errState}
                              />
                              {input.errState ? (
                                <Typography color="secondary">
                                  {input.value === ""
                                    ? input.errEmptyMsg
                                    : input.value.length < 3
                                    ? input.errMinMsg
                                    : input.value.length > 10
                                    ? input.errMaxMsg
                                    : null}
                                </Typography>
                              ) : null}
                            </Grid>
                          </Grid>
                        </Grid>
                      ))}

                      {testData.radio.map((input: any, index: any) => (
                        <>
                          {input.type === "radio" ? (
                            <>
                              <Grid item xs={6} md={4} lg={3}>
                                <Grid container direction="column">
                                  <Grid item>
                                    <Typography
                                      variant="body1"
                                      style={{ fontWeight: 600 }}
                                      key={index}
                                    >
                                      {input.textlabel}
                                    </Typography>
                                  </Grid>

                                  <Grid item>
                                    {input.list.map((item: any) => {
                                      return (
                                        <>
                                          <RadioButtonComp
                                            label={item.name}
                                            color="primary"
                                            size="small"
                                            checked={checked}
                                            handleRadio={handleRadio}
                                          />
                                        </>
                                      );
                                    })}
                                  </Grid>
                                </Grid>
                              </Grid>
                            </>
                          ) : (
                            <>
                              <Grid item xs={6} md={4} lg={3}>
                                <Typography
                                  variant="body1"
                                  style={{ fontWeight: 600 }}
                                >
                                  {input.textlabel}
                                </Typography>
                                <FormControl fullWidth>
                                  {/* <Select
                                    labelId="demo-customized-select-label"
                                    id="demo-customized-select"
                                    input={<BootstrapInput />}
                                    fullWidth
                                    name={input.name}
                                    // required={input.required}
                                    onChange={(e) =>
                                      handleupdate(e, input.textlabel)
                                    }
                                  >
                                    {input.list.map((item: any, index: any) => {
                                      return (
                                        <MenuItem value={index + 1}>
                                          <Typography
                                            style={{ fontSize: "12px" }}
                                          >
                                            {item.name}
                                          </Typography>
                                        </MenuItem>
                                      );
                                    })}
                                  </Select> */}

                                  <Dropdown
                                    input={input}
                                    handleChange={handleupdate}
                                  />
                                </FormControl>
                              </Grid>
                            </>
                          )}
                        </>
                      ))}

                      <Grid container direction="row" spacing={2}>
                        {loop?.map((item: any) => {
                          return (
                            <Grid item xs={6}>
                              <Typography
                                variant="body1"
                                style={{ fontWeight: 600, marginLeft: "20px" }}
                              >
                                {"Request Admit Date"}
                              </Typography>

                              <FormControl fullWidth>
                                {/* <Select
                                  labelId="demo-customized-select-label"
                                  id="demo-customized-select"
                                  input={<BootstrapInput />}
                                  style={{ width: "90%", marginLeft: "10px" }}
                                >
                                  {item.list.map((li: { name: string }) => {
                                    return (
                                      <MenuItem value={li.name}>
                                        <Typography>{li.name}</Typography>
                                      </MenuItem>
                                    );
                                  })}
                                </Select> */}
                                <Dropdown
                                  input={item}
                                  handleChange={handleselect}
                                />
                              </FormControl>
                            </Grid>
                          );
                        })}

                        {loop.map(() => {
                          return (
                            <Grid item xs={6} md={4} lg={3}>
                              <Grid container direction="column">
                                <Grid item>
                                  <Typography
                                    variant="body1"
                                    style={{
                                      fontWeight: 600,
                                      marginLeft: "10px",
                                    }}
                                  >
                                    {"Admit Type"}
                                  </Typography>
                                </Grid>
                                <Grid item>
                                  <InputField
                                    variant="outlined"
                                    size="small"
                                    fullWidth
                                    // className={text}
                                  />
                                </Grid>
                              </Grid>
                            </Grid>
                          );
                        })}
                      </Grid>
                    </Grid>

                    <br />
                    <div>
                      <Typography variant="h5" className={classes.typomobile}>
                        Searching and Facility Provider Information
                      </Typography>
                    </div>

                    <Typography style={{ paddingTop: "5px" }}>
                      Servicing facility provider information
                    </Typography>
                    <div className={classes.tool}>
                      <Grid container xs={12}>
                        <Grid item xs={6} md={8} lg={9}>
                          <Typography
                            variant="h6"
                            style={{ marginLeft: "24px" }}
                            className={classes.servicetypo}
                          >
                            Searching and Facility Providers
                          </Typography>
                        </Grid>

                        <Grid item xs={6} md={4} lg={3}>
                          <IconButton
                            icon="circle"
                            variant="contained"
                            btn="btn"
                            handleClick={() => setserviceProvider(true)}
                          >
                            Add Provider
                          </IconButton>
                        </Grid>
                      </Grid>
                    </div>

                    <div>
                      <Toolbar className={classes.toolbarItem2}>
                        <div className={classes.gridContainer}>
                          <Datatable
                            rows={mainlist}
                            rowsshow={mainlist.length > 0 ? true : false}
                            headCells={ServiceheadCells}
                            handlerowdata={[]}
                            IcdModal={false}
                          />
                        </div>
                      </Toolbar>
                    </div>
                    <br />

                    <div>
                      <Typography
                        variant="h5"
                        style={{
                          color: "#383131",
                          borderBottom: "1px solid #d6d0d0",
                        }}
                      >
                        *Diagnosis
                      </Typography>
                    </div>
                    <Typography style={{ paddingTop: "5px" }}>
                      Please add all diagnosis before selecting procedure
                    </Typography>

                    <Toolbar className={classes.tool}>
                      <Grid container>
                        <Grid item xs={6} md={8} lg={9}>
                          <Typography
                            variant="h6"
                            className={classes.servicetypo}
                          >
                            ICD - Search Results
                          </Typography>
                        </Grid>

                        <Grid item xs={6} md={4} lg={3}>
                          <IconButton
                            icon="circle"
                            variant="contained"
                            handleClick={() => setIcdmodal(true)}
                            btn="diagnosisbtn"
                          >
                            Add Diagnosis
                          </IconButton>
                        </Grid>
                      </Grid>
                    </Toolbar>
                    <Toolbar className={classes.toolbarItem2}>
                      <div className={classes.gridContainer}>
                        <Datatable
                          headCells={icdheadCells}
                          rowsshow={selectIcddetails.length > 0 ? true : false}
                          rows={selectIcddetails || [{}]}
                          handlerowdata={[]}
                          IcdModal={false}
                        />
                      </div>
                    </Toolbar>

                    <div className={classes.resetbtn}>
                      <IconButton
                        icon="left"
                        variant="contained"
                        type="reset"
                        color="primary"
                      >
                        Cancel
                      </IconButton>

                      <IconButton
                        icon="right"
                        variant="contained"
                        type="submit"
                        color="primary"
                      >
                        Submit
                      </IconButton>
                    </div>
                  </form>
                </Toolbar>
              )}
            </Grid>
          </Grid>
        </Grid>
      </div>

      <Formmodal
        open={serviceProvider}
        handleClose={handleClose}
        setmodalformdata={setmodalformdata}
        modalformdata={modalformdata}
        handleSubmit={handleSubmit}
      />

      <IcdModal
        open={IcdmodalOpen}
        handleClose={handleClose}
        setselectIcddetails={setselectIcddetails}
        setIcdmodal={setIcdmodal}
        selectIcddetails={selectIcddetails}
      />
      <SnackBar
        handleClose={handleSnackbarClose}
        open={snackBarOpen}
        severity={severity}
        message={message}
      />
    </>
  );
}
